import React from "react";
import { NavLink } from "react-router-dom";
import { Sidebar } from "../../components";
import style from "./style.module.css";

export const Dashboard = () => {
  return (
    <div className={style.dashboard}>
      <Sidebar>
        <img src="../../logo.png" alt="logo" />
        <ul>
          <li>
            <NavLink
              to="/"
              style={({ isActive }) => {
                return {
                  display: "block",
                  margin: "1rem 0",
                  color: isActive ? "red" : "",
                };
              }}
            >
              Головна
            </NavLink>
          </li>
          <li>
            <NavLink to="/add-pacient">Додати паціента</NavLink>
          </li>
          <li>
            <NavLink to="/add-doctor">Додати лікаря</NavLink>
          </li>
        </ul>
      </Sidebar>
      <div>Content</div>
    </div>
  );
};
